import React from 'react';
import hero from '../assets/home/photoguy.png';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <section className='section'>
      <div className='container mx-auto h-full relative'>
        <div className='flex flex-col justify-center'>
          <div className='w-full pt-10 pb-8 lg:pt-0 lg:pb-0 lg:w-1/2 lg:absolute lg:left-0 lg:top-1/2 lg:transform lg:-translate-y-1/2 lg:pl-10'>
            <h1 className='text-4xl lg:text-6xl font-primary font-bold leading-tight mb-4 lg:mb-8'>
              Nature<br />& <br />Landscape <br />Photographer
            </h1>
            <p className='text-lg lg:text-xl font-primary mb-4 lg:mb-8'>San Francisco, CA & Dallas, TX</p>
            <Link to='/contact' className='btn mb-4 lg:mb-8'>Let's Connect</Link>
          </div>
          <div className='flex justify-end max-h-80 lg:max-h-full lg:w-1/2'>
            <div className='relative overflow-hidden'>
              <img src={hero} alt='Photographer' className='max-w-full h-auto' />
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Home;
